var info = L.control();

		info.onAdd = function (map) {
			this._div = L.DomUtil.create('div', 'info');
			this.update();
			return this._div;
		};

		info.update = function (props) {
			//this._div.innerHTML = '<h4>US Population Density</h4>' + (props ?
   //             '<b>' + props.name + '</b><br />' + props.Density + ' people / mi<sup>2</sup>' : 'Hover over a state');
			
			this._div.innerHTML = '<h4>India Districts</h4>' + (props ?
				'<b>' + props.DN + '</b><br />' : 'Hover over a District');
			
			if(OpVal=="Graduate Education"){
			this._div.innerHTML = '<h4>India Graduate Education Density</h4>' + (props ?
				'<b>' + props.DN + '</b><br />' + props.GE_D : 'Hover over a District');
			}
			if(OpVal=="Literacy"){
			this._div.innerHTML = '<h4>India Literacy Density</h4>' + (props ?
				'<b>' + props.DN + '</b><br />' + props.LT_D : 'Hover over a District');
			}
			if(OpVal=="Ages 0 to 29"){
			this._div.innerHTML = '<h4>India Ages 0 to 29 Density</h4>' + (props ?
				'<b>' + props.DN + '</b><br />' + props.AG029_D : 'Hover over a District');
			}
			if(OpVal=="Non Workers"){
			this._div.innerHTML = '<h4>India Non Workers Density</h4>' + (props ?
				'<b>' + props.DN + '</b><br />' + props.NW_D : 'Hover over a District');
			}
			if(OpVal=="Population"){
			this._div.innerHTML = '<h4>India Population</h4>' + (props ?
				'<b>' + props.DN + '</b><br />' + props.P_D : 'Hover over a District');
			}

		};

		info.addTo(map);


		function getColor(d) {

				return d == 'YES' ? 'red':'white';
			

			
		}

		function style(feature) {


			return {
					weight: 1.5,
					opacity: 1,
					color:'white',
					dashArray: '3',
					fillOpacity: 0.7,
					fillColor: getColor(feature.properties.COMB_RES)
				};

		
		}

		function highlightFeature(e) {
			var layer = e.target;

			layer.setStyle({
				weight: 1.5,
				color: '#333',
				dashArray: '',
				fillOpacity: 0.7
			});

			if (!L.Browser.ie && !L.Browser.opera && !L.Browser.edge) {
				layer.bringToFront();
			}

			info.update(layer.feature.properties);
		}

		var geojson;


		function resetHighlight(e) {
			geojson.resetStyle(e.target);
			info.update();
		}

		function zoomToFeature(e) {
			map.fitBounds(e.target.getBounds());
		}

		function onEachFeature(feature, layer) {
			layer.on({
				mouseover: highlightFeature,
				mouseout: resetHighlight,
				click: zoomToFeature
			});
		}

		geojson = L.geoJson(districtsData, {
			style: style,
			onEachFeature: onEachFeature
		}).addTo(map);
var legend = L.control({ position: 'bottomright' });

            // other grades
			var labels = [];

				from = grades[i];
				to = grades[i + 1];

				labels.push(
					//'<i style="background:' + getColor(from + 1) + '"></i> ' +
     //               from + (to ? '&ndash;' + to : '+'));
                '<i style="background:' + colors[i] + '"></i> ' +
                    from);
			}

			div.innerHTML = labels.join('<br>');
			return div;
		};

		legend.addTo(map);
